const a={a1:"纸片是一种小块的用来呈现复杂实体的块，比如联系人。",a2:"纸片可以包含一张照片、文本、一个图标、或者一个联系人。",a3:"<strong>联系人纸片</strong>可以以一种紧凑的方式展现联系人信息。",a4:"行为",a5:"选择一个纸片，以打开一个完整的详细信息视图。",a6:"如果纸片包含了删除图标，则可以被删除。",a7:"规格",a8:"高度：",a9:"标签：",a10:"用法",a11:"行为",a12:"联系人纸片",a13:"规格",a14:"纸片可以包含照片、短文本、和简短的信息。",a15:"纸片类型",a16:"纸片可用于多种类型的实体，包括自由格式的文本、预定义文本、或联系人。纸片也可以包含图标。",a17:"含文本的纸片",a18:"纸片标签",a19:"含文本和图标的纸片",a20:"打开纸片",a21:"触摸纸片打开完整的详细信息视图（在卡片中或全屏）、或打开与该纸片相关的菜单。",a22:"删除纸片",a23:"纸片可以是可删除的或不可删除的。如果是可删除的，显示删除图标。",a24:"用户可以点击删除图标、或者按键盘上的 “Delete” 键来删除纸片。",a25:"可以使用联系人纸片来以一种紧凑的方式展现用户的联系人信息。当用户在输入框（通常是 “To” 字段）中输入一个联系人的名字时，联系人纸片会被触发，并显示联系人的地址以供用户进行选择。联系人纸片可以直接被添加到文本框中。",a26:"联系人纸片主要用于帮助用户准确高效地选择收件人。",a27:"用户在联系人纸片上确认邮件接收者的姓名。",a28:"用户在联系人纸片确认选择哪个邮件地址。",a29:"联系人纸片有多种不同的状态：正常、聚焦、按下、和激活。",a30:"单行纸片",a31:"可删除纸片",a32:"高度：",a33:"标签左侧内边距：",a34:"删除图标",a35:"尺寸：",a36:"颜色和不透明度：",a37:"外边距：",a38:"在桌面端。 “删除” 图标是一直显示着的。",a39:"不可删除的纸片",a40:"标签左右内边距：",a41:"联系人纸片",a42:"标签右侧内边距：",a43:"联系人纸片",a44:"关闭状态的联系人纸片",a45:"联系人名称文本：Roboto Regular 14sp",a46:"聚焦后，纸片的海拔高度会上升到 2dp。按下时，它会展开以显示联系人的其他地址",a47:"打开状态的联系人纸片",a48:"联系人名称文本：Roboto Regular 16sp",a49:"地址文本：Roboto Regular 14sp",a50:"打开状态的联系人纸片的海拔高度为 8dp",a51:"按下时，联系人纸片会自动关闭",a52:"默认状态下，顶部的条目会处于激活并聚焦状态",a53:"联系人纸片",a54:"标题顶部、底部、左侧内边距：",a55:"标题右侧内边距：",a56:"聚焦和激活状态的联系人纸片",a57:"顶部和底部内边距：",a58:"未聚焦状态的联系人纸片",a59:"Material Design 中的纸片用于展示复杂信息，例如联系人",a60:"Material Design 中的纸片效果",a61:"Material Design 中的纸片与图标组合",a62:"Material Design 中的联系人纸片的确认姓名",a63:"Material Design 中的联系人纸片的选择邮件地址",a64:"Material Design 中联系人纸片的不同状态展示",a65:"Material Design 中的单行纸片规格",a66:"Material Design 中的单行纸片规格",a67:"Material Design 中的联系人纸片",a68:"Material Design 中的聚焦和激活状态联系人卡片"};export{a as zhCn};
